export default function About() {
    function Summary() {
        return (
            <>
            <h3>Summary and Skills</h3>
            Hello! My name is Viviana Alba and I am a full stack developer.
            I have a background in molecular biology and clinical research, which
            led me to find a passion for coding. I have always been a curious person with 
            a knack for problem solving.
            <br/><br/>
            Results-oriented web developer with a solid foundation in computer science with a proven track record of delivering high-quality code on time and within budget. Adept at communicating complex technical concepts to diverse audiences. Eager to leverage technical expertise and creativity to drive impactful projects in a dynamic software engineering role.
            <br/><br/>
            Tech: JavaScript, React, MongoDB, CSS, HTML, Python, SQL, R, Tableau<br/> 
            Productivity: Microsoft Office,  Slack, Asana, Google Workspace, Trello<br/> 
            Languages: Spanish (Fluent)
            </>
        )
    }

    return(
        <div className="about-me">
            <h2>About Me</h2>
            <Summary />
        </div>
    )
}
